def year_fix(day):
    # day_time = datetime.datetime.strptime(day, "%Y/%m/%d")
    year = day.strftime("%Y")

    return year


def season_fix(day):
    # day_time = datetime.datetime.strptime(day, "%Y/%m/%d")
    year = day.strftime("%Y")
    month = day.strftime("%m")
    if month in ["01", "02", "03"]:
        season = year + "S1"
    elif month in ["04", "05", "06"]:
        season = year + "S2"
    elif month in ["07", "08", "09"]:
        season = year + "S3"
    else:
        season = year + "S4"
    return season


def findStarLevel(hotels, datasets):
    economy = []
    luxury = []
    df = datasets[["åç§°", "æ˜Ÿçº§"]]
    df = df.drop_duplicates(subset="åç§°", keep="first")
    for index, row in df.iterrows():
        # print(row)
        # print(type(row["æ˜Ÿçº§"]))
        name = row["åç§°"]
        star = str(row["æ˜Ÿçº§"])
        if name not in hotels:
            continue
        if star in ["2", "3"]:
            economy.append(name)
        else:
            luxury.append(name)
    return economy, luxury


